    <Button>
      {!inputVisible && <TitleButton onClick={() => setInputVisible(true)}>
        Criar Novo Time
      </TitleButton>}
      {inputVisible && <form>
          <Input/>
          <button>criar</button>
        </form>}
    </Button>
  );
}
